import React from "react";
import "./css/Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div className="footer__container">
        <div className="address__container">
          <h2>Head Office</h2>
        </div>
      </div>
    </div>
  );
}

export default Footer;
